class Solution {

    /**
     * @param Integer[][] $grid
     * @return Integer[]
     */
    function goodSubsetofBinaryMatrix($grid) {
        $rowCount = count($grid);
        $colCount = count($grid[0]);
        $maxSubset = [];

        // For each row, compute a bitmask representing its columns.
        $rowBitmasks = [];
        foreach ($grid as $r => $row) {
            $mask = 0;
            foreach ($row as $c => $val) {
                if ($val === 1) {
                    $mask |= (1 << $c);
                }
            }
            $rowBitmasks[$r] = $mask;
        }

        // Check all subsets of rows
        for ($i = 1; $i < (1 << $rowCount); $i++) {
            $colsSum = array_fill(0, $colCount, 0);
            $subset = [];
            for ($j = 0; $j < $rowCount; $j++) {
                if (($i & (1 << $j)) > 0) {
                    $subset[] = $j;
                    // Update column sums for this subset
                    for ($k = 0; $k < $colCount; $k++) {
                        if (($rowBitmasks[$j] & (1 << $k)) > 0) {
                            $colsSum[$k]++;
                        }
                    }
                }
            }
            $isValid = true;
            foreach ($colsSum as $sum) {
                if ($sum > floor(count($subset) / 2)) {
                    $isValid = false;
                    break;
                }
            }
            if ($isValid && count($subset) > count($maxSubset)) {
                $maxSubset = $subset;
            }
        }

        return $maxSubset;
    }
}
